nd/or purchasing\r\n(e.g., watching, reading) history in order to extract\r\na set of interesting items for each user.</p>\r\n        \r\n      </div>\r\n      <div class=\"clr\"></div>\r\n    </div>\r\n  </div>\r\n  <div class=\"footer\">\r\n    <div class=\"footer_resize\">\r\n      <p class=\"lf\">&copy; Copyright <a href=\"http://www.tmksinfotech.com\">tmksinfotech.com</a>.</p>\r\n    \r\n      <div style=\"clear:both;\"></div>\r\n    </div>\r\n  </div>\r\n</div>\r\n</body>\r\n</html>\r\n','[B@9c67db','24/05/2016   14:20:24');
insert into `mdcci_cloudserver` (`fname`,`ownername`,`ct`,`sk`,`dt`) values ('A_MainPage.jsp','prakash','<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\" \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\r\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\r\n<head>\r\n<title>Cold-Start Recommendation with Provable\r\nGuarantees: A Decoupled Approach</title>\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<link href=\"css/style.css\" rel=\"stylesheet\" type=\"text/css\" />\r\n<link rel=\"stylesheet\" type=\"text/css\" href=\"css/coin-slider.css\" />\r\n<script type=\"text/javascript\" src=\"js/cufon-yui.js\"></script>\r\n<script type=\"text/javascript\" src=\"js/cufon-ubuntu.js\"></script>\r\n<script type=\"text/javascript\" src=\"js/jquery-1.4.2.min.js\"></script>\r\n<script type=\"text/javascript\" src=\"js/script.js\"></script>\r\n<script type=\"text/javascript\" src=\"js/coin-slider.min.js\"></script>\r\n</head>\r\n<body>\r\n<div class=\"main\">\r\n  <div class=\"header\">\r\n    <div class=\"header_resize\">\r\n      <div class=\"logo\">\r\n        <h2 align=\"center\"><a href=\"index.html\">Cold-Start Recommendation with Provable\r\nGuarantees: A Decoupled Approach</a></h2>\r\n      </div>\r\n      <div class=\"clr\"></div>\r\n      <div class=\"menu_nav\">\r\n        <ul>\r\n          <li class=\"active\"><a href=\"A_Homepage.html\"><span>Home Page</span></a></li>\r\n          <li><a href=\"#\"><span>End User</span></a></li>\r\n          <li><a href=\"E_HomePage.html\"><span>Admin</span></a></li>\r\n          <li><a href=\"about.html\"><span>About Us</span></a></li>\r\n          <li><a href=\"#\"><span>Register</span></a></li>\r\n        </ul>\r\n      </div>\r\n      <div class=\"clr\"></div>\r\n      <div class=\"slider\">\r\n        <div id=\"coin-slider\"> <a href=\"#\"><img src=\"images/slide1.jpg\" width=\"960\" height=\"320\" alt=\"\" /></a> <a href=\"#\"><img src=\"images/slide2.jpg\" width=\"960\" height=\"320\" alt=\"\" /></a> <a href=\"#\"><img src=\"images/slide3.jpg\" width=\"960\" height=\"320\" alt=\"\" /></a> </div>\r\n        <div class=\"clr\"></div>\r\n      </div>\r\n      <div class=\"clr\"></div>\r\n    </div>\r\n  </div>\r\n  <div class=\"content\">\r\n    <div class=\"content_resize\">\r\n      <div class=\"mainbar\">\r\n        <div class=\"article\">\r\n          <h2><span>Cold-Start Recommendation</span>  with Provable Guarantees: A Decoupled Approach</h2>\r\n          <p class=\"infopost\"></p>\r\n          <div class=\"clr\"></div>\r\n          <div class=\"img\"><img src=\"images/img1.jpg\" width=\"620\" height=\"154\" alt=\"\" class=\"fl\" /></div>\r\n          <div class=\"post_content\">\r\n           <p>Although the matrix completion paradigm provides an appealing solution to the collaborative filtering problem in\r\nrecommendation systems, some major issues, such as data sparsity and cold-start problems, still remain open. In particular,\r\nwhen the rating data for a subset of users or items is entirely missing, commonly known as the cold-start problem, the standard\r\nmatrix completion methods are inapplicable due the non-uniform sampling of available ratings. In recent years there has been\r\nconsiderable interest in dealing with cold-start users or items that are principally based on the idea of exploiting other sources of\r\ninformation to compensate for this lack of rating data. In this paper, we propose a novel and general algorithmic framework based\r\non matrix factorization that simultaneously exploits the similarity information among users and items to alleviate the cold-start\r\nproblem. In contrast to existing methods, our proposed recommender algorithm, dubbed DecRec, decouples the following two\r\naspects of the cold-start problem to effectively exploit the side information: (i) the completion of a rating sub-matrix, which is\r\ngenerated by excluding cold-start users/items from the original rating matrix; and (ii) the transduction of knowledge from existing\r\nratings to cold-start items/users using side information. This crucial difference prevents the error propagation of completion and\r\ntransduction, and also significantly boosts the performance when appropriate side information is incorporated. The recovery error\r\nof the proposed algorithm is analyzed theoretically and, to the best of our knowledge, this is the first algorithm that addresses the\r\ncold-start problem with provable guarantees on performance. Additionally, we also are able to apply our algorithm in situations\r\nwhere both cold-start users and items are present simultaneously. We conduct thorough experiments on real datasets that\r\ncomplement our theoretical results. These experiments demonstrate the effectiveness of the proposed algorithm in handling the\r\ncold-start users/items problem and mitigating data sparsity issues.</p>\r\n          </div>\r\n          <div class=\"clr\"></div>\r\n        </div>\r\n        <div class=\"article\">\r\n          \r\n          </div>\r\n          <div class=\"clr\"></div>\r\n        </div>\r\n     \r\n      </div>\r\n      <div class=\"sidebar\">\r\n        <div class=\"searchform\">\r\n          <form id=\"formsearch\" name=\"formsearch\" method=\"post\" action=\"#\">\r\n            <span>\r\n            <input name=\"editbox_search\" class=\"editbox_search\" id=\"editbox_search\" maxlength=\"80\" value=\"Search our ste:\" type=\"text\" />\r\n            </span>\r\n            <input name=\"button_search\" src=\"images/search.gif\" class=\"button_search\" type=\"image\" />\r\n          </form>\r\n        </div>\r\n        <div class=\"clr\"></div>\r\n        <div class=\"gadget\">\r\n          <h2 class=\"star\"><span>Sidebar</span> Menu</h2>\r\n          <div class=\"clr\"></div>\r\n          <ul class=\"sb_menu\">\r\n		   <li><a href=\"A_HomePage.html\"><span>Home</span></a></li>\r\n		    <li><a href=\"A_ViewUsers.html\"><span>View Users & Authorize</span></a></li>\r\n            <li class=\"active\"><a href=\"A_AddPosts.html\"><span>Add Posts </span></a></li>\r\n          <li><a href=\"A_ViewPosts.html\"><span>View Posts with Ranks</span></a></li>\r\n		    <li><a href=\"A_ViewRecomendation.html\"><span>View Recomendation By Location</span></a></li>\r\n          <li><a href=\"A_ViewReviews.html\"><span>View Reviewed Posts</span></a></li>\r\n          <li><a href=\"A_ViewSearch.html\"><span>View Search History</span></a></li>\r\n		   <li><a href=\"A_ViewSLUsers.html\"><span>View Users By Location</span></a></li>\r\n		    <li><a href=\"A_ViewUserServices.html\"><span>View User Services</span></a></li>\r\n			 <li><a href=\"A_Transaction.html\"><span>View Transactions</span></a></li>\r\n			 	 <li><a href=\"A_ColdStart.html\"><span>View Cold Start Recomendation Matrix</span></a></li>\r\n				  <li><a href=\"A_Results.html\"><span>Results</span></a></li>\r\n          <li><a href=\"index.html\"><span>LogOut</span></a></li>\r\n          </ul>\r\n        </div>\r\n        <div class=\"gadget\">\r\n          <h2 class=\"star\"><span>Concepts</span></h2>\r\n          <div class=\"clr\"></div>\r\n          <ul class=\"ex_menu\">\r\n            <li><a href=\"#\">Recommender Systems</a><br />\r\n             </li>\r\n            <li><a href=\"#\">Cold-start Problem</a><br />\r\n              </li>\r\n            <li><a href=\"#\">Matrix Completion</a><br />\r\n              </li>\r\n            <li><a href=\"#\">Transduction</a><br />\r\n              </li>\r\n           \r\n          </ul>\r\n        </div>\r\n      </div>\r\n      <div class=\"clr\"></div>\r\n    </div>\r\n  </div>\r\n  <div class=\"fbg\">\r\n    <div class=\"fbg_resize\">\r\n      <div class=\"col c1\">\r\n        <h2><span>Image</span> Gallery</h2>\r\n        <a href=\"#\"><img src=\"images/gal1.jpg\" width=\"75\" height=\"75\" alt=\"\" class=\"gal\" /></a> <a href=\"#\"><img src=\"images/gal2.jpg\" width=\"75\" height=\"75\" alt=\"\" class=\"gal\" /></a> <a href=\"#\"><img src=\"images/gal3.jpg\" width=\"75\" height=\"75\" alt=\"\" class=\"gal\" /></a> <a href=\"#\"><img src=\"images/gal4.jpg\" width=\"75\" height=\"75\" alt=\"\" class=\"gal\" /></a> <a href=\"#\"><img src=\"images/gal5.jpg\" width=\"75\" height=\"75\" alt=\"\" class=\"gal\" /></a> <a href=\"#\"><img src=\"images/gal6.jpg\" width=\"75\" height=\"75\" alt=\"\" class=\"gal\" /></a> </div>\r\n      <div class=\"col c2\">\r\n        <h2><span>Concept</span> Overview</h2>\r\n        <p>DUE to the popularity and exponential growth\r\nof e-commerce websites (e.g. Amazon, eBay)\r\nand online streaming websites (e.g. Netflix, Hulu),\r\na compelling demand has been created for efficient\r\nrecommender systems to guide users toward items\r\nof their interests (e.g. products, books, movies). Recommender\r\nsystems seek to predict the rating that a\r\nuser would give to an item and further try to suggest\r\nitems that are most appealing to the users. Recently,\r\nrecommender systems have received a considerable\r\namount of attention and have been the main focus of\r\nmany research studies.</p>\r\n       \r\n      </div>\r\n      <div class=\"col c3\">\r\n        <h2><span>Concept</span> Overview</h2>\r\n        <p>Content-based filtering (CB) and collaborative filtering\r\n(CF) are well-known examples of recommendation\r\napproaches. As demonstrated by its performance\r\nin the KDD Cup [12] and Netflix competition [5],\r\nthe most successful recommendation technique used\r\nis collaborative filtering. This technique exploits the\r\nusersÃ¢Â€Â™ opinions (e.g., movie ratings) and/or purchasing\r\n(e.g., watching, reading) history in order to extract\r\na set of interesting items for each user.</p>\r\n        \r\n      </div>\r\n      <div class=\"clr\"></div>\r\n    </div>\r\n  </div>\r\n  <div class=\"footer\">\r\n    <div class=\"footer_resize\">\r\n      <p class=\"lf\">&copy; Copyright <a href=\"http://www.tmksinfotech.com\">tmksinfotech.com</a>.</p>\r\n    \r\n      <div style=\"clear:both;\"></div>\r\n    </div>\r\n  </div>\r\n</div>\r\n</body>\r\n</html>\r\n','[B@dc51c8','24/05/2016   18:26:23');
